  private readonly productsKey = 'demo_products';

  constructor() {
    this._ensureSeed();
  }

  private _read(): Product[] {
    try {
      const raw = localStorage.getItem(this.productsKey);
      return raw ? (JSON.parse(raw) as Product[]) : [];
    } catch {
      return [];
    }
  }

  private _write(list: Product[]) {
    try {
      localStorage.setItem(this.productsKey, JSON.stringify(list));
    } catch (e) {
      console.warn('product save failed', e);
    }
  }

